import React from 'react'
import {useState} from 'react'
function App() {
  const [obj, setObj] = useState(
    { 
      name : 'eunji',
      job : 'onehundredwater'
    }
  )
  return (
    <div>
    <div>{obj.name}</div>

    <button onClick={() => {
       obj.name = 'twoji';
      const obj2 = {...obj}
      setObj(obj2);
      }}
      >
      </button>
    </div>
  )
}
export default App
